import React,{ Component  } from "react";
import {MDBCard, MDBCardBody, MDBCardHeader, MDBTable, MDBTableBody, MDBTableHead} from "mdbreact";
class Company extends Component{
    render() {
        return(
            <div className="row">
                <div className="col-sm-3"></div>
                <div className="col-lg-5 col-md-8 col-sm-12 ">
                    <MDBCard >
                        <MDBCardHeader tag="h3" style={{ backgroundColor: "#9ACD32", color: "white" }}
                                       className="text-center font-weight-bold text-uppercase py-4">
                            Items Detail for '{this.props.match.params.slagme}'
                        </MDBCardHeader>

                        <MDBCardBody>
                            <MDBTable  responsive striped hover bordered>
                                <MDBTableHead>
                                    <tr>
                                        <th>Item_detail</th>
                                        <th>Qunatity</th>
                                        <th>price</th>
                                    </tr>
                                </MDBTableHead>
                                <MDBTableBody>

                                    {

                                        this.state.item.map((items,i) =>{
                                            return(
                                                <tr key={i}>
                                                    <td>{items.detail}</td>
                                                    <td>{items.qty}</td>
                                                    <td>{items.price}</td>

                                                </tr>

                                            )  })}
                                </MDBTableBody>
                            </MDBTable>
                        </MDBCardBody>
                    </MDBCard>




                </div>
            </div>


        )
    }
}
export default Company;
